import React, { Component } from 'react';
import { Route, NavLink } from 'react-router-dom';
import Header from '../../components/Header';
import { Button, Avatar, Menu, Dropdown, Icon } from 'antd';
const activeLink = {
  color: 'blue',
  fontWeight: 'bold',
}
class Dashboard extends Component {
  render() {
    return (
      <div>
        <Header />
        <Button>123</Button>
        <div>
          <NavLink to="/hello" activeStyle={activeLink}>Hello页面</NavLink> | 
          | <NavLink to="/hello/list" activeStyle={activeLink}>Hello-----list页面</NavLink> |  
          | <NavLink to="/hello/detail" activeStyle={activeLink}>Hello----detail页面</NavLink> | 
          | <NavLink to="/hi/123" activeStyle={activeLink}>Hi页面</NavLink>
        </div>
        { this.props.children }
      </div>
    )
  }
}

export default Dashboard;
